import React from 'react'
import {Route, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const PrivateAdminRoute = ({component : Component, authenticated, fullname, ...rest}) => (

    <Route
    {...rest}
    render={(props) =>

        (authenticated === true && props.history === "h") ? <Component {...props} /> : <Redirect to='/' />
    }
    />
);

const mapStateToProps = (state) => ({
    authenticated: state.admin.authenticated,
    fullname: state.admin.fullname

});

PrivateAdminRoute.prototype = {
    admin: PropTypes.object
}

export default connect(mapStateToProps)(PrivateAdminRoute);
